    const navigate = useNavigate()

    const logout = async () => {
        setAuth({})
        navigate('/')
    }

    return (
        <section>
            <h1>NOT IMPLEMENTED: POSTS</h1>
            <div>
                <button onClick={logout}>Logout</button>
            </div>
        </section>

    )
}

export default Posts
